import React from 'react';
import CategoryItem from '../CategoryItem/CategoryItem';
import './Category.css';

const Category=(props)=>{
    let DataProductList=props.DataProductList;
    let group=[... new Set(DataProductList.map(x=>x.categoryGroup))];
    console.log('props.selectedCategory',props.selectedCategoryGroup);
    return(
        <div className="Category">
            <div className="category-header">Category</div>
            {group.map(x=>(<div className={"category-item "+(x==props.selectedCategoryGroup?"selected":"")} 
                                key={x} onClick={()=>props.changeCategory(x)}>{x}<span className="downside">{">"}</span>
                                {(x==props.selectedCategoryGroup?<CategoryItem/>:null)}   
                            </div>))}            
        </div>
    );
}

export default Category;
